import React from 'react';
import { Link } from 'react-router-dom';
import ModelCard from './ModelCard'



function ModelList({things}){

    return(
        <div>
            {things.map(thing => (
                <Link to='/model'>
                    <ModelCard thing={thing}/>
                    <p>{thing.name}</p>
                </Link>

            ))}
        </div>
    )

}

export default ModelList
